-- [CREATING A NEW DATABASE]

DROP TABLE IF EXISTS `tcf_schools`;

CREATE TABLE `tcf_schools` (
    `Name_of_school`	VARCHAR(512),
    `Province`	VARCHAR(512),
    `District`	VARCHAR(512),
    `Region`	VARCHAR(512),
    `Date_of_Start`	INT,
    `No_of_unit`	VARCHAR(512),
    `Category`	VARCHAR(512),
    `Shfit`	VARCHAR(512),
    `Strength`	INT
);

    
    -- [DATA CLEANING]
    
-- deleting unncessary columns

-- removing province name from school name i.e (Sindh)
update tcf_schools
set Name_of_school = substring_index(Name_of_school, '(' , 1)
;
-- removing brackets from province names i.e ()
update tcf_schools
set Province = substring_index(substring_index(Province, '(', -1), ')', 1)
;

-- converting first letter of each District to Upper case
update tcf_schools
set District = concat(upper(substring(District, 1 ,1)) ,  substring(District, 2))
;


